handlePlayer = function(player) {
  var g, gs;
  g = globals;
  gs = g.settings;
  if (gs.timeout) {
    return;
  }
  if (gs.paused) {
    sound.play();
  } else if (gs.player === -1) {
    sound.play();
  } else if (gs.player === player) {
    sound.play();
    gs.clocks[player] += gs.bonuses[player];
  }
  gs.paused = false;
  return gs.player = 1 - player;
};

